	  509604,"12",310,44,1942,
	  "0.10 USD",68.000,"monthly","1st Holyoke issue numbering continuing from Blue Beetle (Fox 1939 series) #11.This issue was clearly put together for Fox as can be seen by the front cover style and the after-the-fact removal of the logo.  However the inside and back covers were produced by Holyoke and include promos related to that publisher.While all other issues from this time period show \"Holyoke Publishing Co. Inc.\" this one clearly has \"Holyoke Publishing Co.\" (no \"Inc.\") in its indicia.  The no-\"Inc.\" form otherwise does not reappear until 1946.",
